import React, { useEffect, useState } from 'react'
import { PokemonContainer } from '../../components/PokemonContainer/PokemonContainer'
import { usePokemons } from '../../hooks/usePokemons'

export const HomePage = () => {
	const [listPokemons, setListPokemons] = useState(usePokemons());

	useEffect(() =>{
		(
			async function(){
					try{
						const response = await fetch("https://pokeapi.co/api/v2/pokemon/?offset=20&limit=20");
						const data = await response.json();
						setListPokemons(data)
						console.log(data)
					}catch(err){
						console.log("err")
					}
			}
	)()
	},[])


  return (
    <div>
			{
				listPokemons.map((pokemon)=>{
					<PokemonContainer onClick={()=> console.log("ir al detalle")} name={pokemon.results.name}/>
				})
			}
    </div>
  )
}
